import React from 'react';
import {
  Button,
  Collapse,
  Navbar,
  NavbarToggler,
  Form,
  FormGroup,
  Input,
  Image,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  UncontrolledDropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  Container } from 'reactstrap';
import logoGarage from './logoGarage.jpeg';


export default class AppNav extends React.Component {
  constructor(props) {
    super(props);

    this.toggle = this.toggle.bind(this);
    this.state = {
      isOpen: false
    };
  }
  toggle() {
    this.setState({
      isOpen: !this.state.isOpen
    });
  }
  render() {
    return (
      <div>
        <Container style={{margin: '0', padding: '0' }}>
        <Navbar style={{backgroundColor: '#1d1d1d', width:'1342px', height:'123px' }} light expand="md">
          {/* <NavbarBrand style={{color: '#a28858'}} href="/">reactstrap</NavbarBrand> */}
          <img src={logoGarage} style={{width: '159px', height: '40px', margin: '70px', paddingTop: '20px' }} />
          <NavbarToggler onClick={this.toggle} />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <Form>
                <FormGroup>
                <Input type="email" name="email" id="exampleEmail" placeholder="Search" />
                </FormGroup>
              </Form>
              <Button></Button>
              <NavItem>
                <NavLink style={{color: '#a28858'}} href="/components/">Register</NavLink>
              </NavItem>
              <NavItem>
                <NavLink style={{color: '#a28858'}} href="#">Sign In</NavLink>
              </NavItem>
              <UncontrolledDropdown nav inNavbar>
                <DropdownToggle nav caret>
                  Options
                </DropdownToggle>
                <DropdownMenu right>
                  <DropdownItem>
                    Option 1
                  </DropdownItem>
                  <DropdownItem>
                    Option 2
                  </DropdownItem>
                  <DropdownItem divider />
                  <DropdownItem>
                    Reset
                  </DropdownItem>
                </DropdownMenu>
              </UncontrolledDropdown>
            </Nav>
          </Collapse>
        </Navbar>
        </Container>
      </div>
    );
  }
}
